import React, { useEffect, useState } from 'react';
import { apiCall } from '../utils/apiCall';

function Adminpage() {

    const [advertises, setAdvertises] = useState([]);

    useEffect(()=>{
        getAdminAdvertise();
    }, [])
    
    function getAdminAdvertise(){
        apiCall('/api/lost/admin-page', 'get').then(res=>{
            setAdvertises(res.data);
            console.log(res.data);
        })
    }

    return (
        <div>
            <div>
                <table>
                    <thead>
                        <tr>
                            <th>t/r</th>
                            <th>firstname</th>
                            <th>lastname</th>
                            <th>age</th>
                            <th>phone number</th>
                            <th>description</th>
                            <th>registry</th>
                            <th>status</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            advertises.map(advertise=> <tr>
                                <td>{advertise.id}</td>
                                <td>{advertise.firstName}</td>
                                <td>{advertise.lastName}</td>
                                <td>{advertise.age}</td>
                                <td>{advertise.phoneNumber}</td>
                                <td>{advertise.description}</td>
                                <td>{advertise.registry}</td>
                                <td>{advertise.status}</td>
                            </tr>)
                        }
                    </tbody>
                </table>
            </div>
        </div>
    );
}

export default Adminpage;
